(1, 'Privacy Policy', 'privacy-policy', '<p>As a company that gives great importance to the privacy of our users and members, we make sure to implement the following policies:</p>\n\n	    					<h4>Sharing of Information</h4>\n	    					<ul>\n		    					<li>Any part of your information will not be shared with any third party websites.</li>\n								<li>We rest assure that any information you input on our website will be used correctly.\n								</li><li>We will not be using your contact information without your prior knowledge, and therefore will only be used with your permission. This information will be utilized solely to personalize your experience with our company and for us to reach out to you when you need us. </li>\n							</ul>\n\n							<h4>Accessing of your Information</h4>\n							<ul>\n								<li>Only people with proper authorization will be able to access any of your data.</li>\n								<li>All necessary preventative measures will be taken to keep every piece of your information accurate and updated.</li>\n								<li>We will always ask for your permission before using any of your information.</li>\n							</ul>\n\n\n							<h4>Changes to our Privacy Policy</h4>\n							<ul>\n								<li>We reserve the right to make any updates and modifications to our policy. This can happen anytime, but we will notify our customers by posting a statement on our homepage regarding these changes.</li>\n								<li>We will also show the date in which these changes will be effective.</li>\n								<li>Customers that continue subscribing to our services means that they have acknowledged and confirmed their acceptance of the changes in this policy.</li>\n							</ul>\n\n							<h4>Your Consent</h4>\n							<p>We would like to remind every visitor that when you visit our site and use any of our services, you automatically agree to our privacy policy regardless if you are a searcher or a member. </p>\n							<p>You may visit our contact us page if you have some questions regarding our Privacy Policy and other queries regarding our company.</p>', NULL, 'page', '24 Hour Emergency Locksmith, Residential Locksmith Service, Commercial Locksmith Service, Automotive Locksmith Service, Emergency Locksmith Service, Industrial Locksmith Service', 'We are a directory of 24 hour locksmith company servicing residential, commercial, automotive, industrial and emergency situation.', NULL, NULL, NULL, 'admin', 1, '2017-07-20 00:00:00', NULL),
(3, 'Contact Us', 'contact-us', '<h2>Get in touch with us.</h2>\r\n<p>Looking for something or have destination suggestions?<br />Tell us about it!</p>', 'Looking for something or have destination suggestions? \r\nTell us about it!', 'page', '24 Hour Emergency Locksmith, Residential Locksmith Service, Commercial Locksmith Service, Automotive Locksmith Service, Emergency Locksmith Service, Industrial Locksmith Service', 'We are a directory of 24 hour locksmith company servicing residential, commercial, automotive, industrial and emergency situation.', NULL, NULL, NULL, 'admin', 1, '2017-08-04 05:14:32', '2017-10-03 03:58:11'),
(19, 'Advantages of Hiring the Best Locksmith Company  in a Car Lockout Situation', 'advantages-of-hiring-the-best-locksmith-company-in-a-car-lockout-situation', '<p>You might laugh at yourself when you realized that your car has automatically locked with the keys inside your vehicle, and what&rsquo;s worse is, you do not have a spare key! That&rsquo;s when the panic and anxiety kick in. Leaving your keys inside a locked car might be the least of your concern but ending up in this kind of situation is no fun and would surely get the best out of you.</p>\r\n<p>In this blog, we are going to talk about the advantages of hiring a professional locksmith in case of an emergency car lockout rather than having someone without experience in dealing with the predicament. Some locks are just complicated most especially to someone without proper training or skills.</p>\r\n<p><strong>Easy and Convenient</strong><br />First of all, there is no denying that locksmith experts are the best people to call as soon as you got problems with either your locks at home, car keys, office locks, safes, commercial cabinet locks and much more. But then, there are still a few people who do not know or fully understand the ease of having a locksmith contact at all times.</p>\r\n<p><strong>24 Hour Availability</strong><br />Though, you&rsquo;ll never wish a lockout would happen to you; for the good part, you won&rsquo;t have to worry when you know there is an available assistance at any hour of the day. What you need to do is store the contact numbers of the best locksmiths in your area, so you have a peace of mind.</p>\r\n<p><strong>Locksmiths are the best at any Lock</strong><br />Locksmith technicians spent so much time training and developing their skills and talents in locksmithing. Not only that, they have the right tools and has learned every method to get you out of a lockout trouble. Thus, when you hire a locksmith expert work with your locks, you surely get the solution best fitted to your current dilemma whether it is a lockout at home, office or car.</p>\r\n<p>While calling one of your relatives or friends might seem to be the best solution, it is still always a smart choice to call the professionals in the field. They are your family in case of a locksmith trouble because that''s what they do and that is their purpose! - To help anyone in an emergency lockout.</p>', 'You might laugh at yourself when you realized that your car has automatically locked with the keys inside your vehicle, and whats worse is, you do not have a spare key! Thats when the panic and anxiety kick in.', 'post', 'automotive locksmiths, locksmith professionals, car lockouts', 'Some locks are just complicated most especially to someone without proper training or skills. Thus, calling the experts is the best option.', 'a:1:{i:0;s:13:"Uncategorized";}', 'automotive locksmith', NULL, 'admin', 1, '2017-09-04 02:59:53', '2017-09-07 03:16:22'),
(28, 'What are the Easy Ways to Improve the Security of Your Home?', 'what-are-the-easy-ways-to-improve-the-security-of-your-home', '<p>Our home should be our haven from the cruel world outside. It&rsquo;s the place we should be living peacefully and protected at all time. That&rsquo;s why we have to make sure that your home is well-protected and won&rsquo;t be an easy target for unwanted guests whether it is day or night. Read on to learn to improve your security.</p>\r\n<ol>\r\n<li>A burglar''s best friend is the dark. The way they see your dark house is a beacon or a sign that said, &ldquo;Burglars are all welcome!&rdquo;. To avoid this, try installing motion sensor lights that can illuminate the front and back part of your home. They are a great way to repel burglars off.</li>\r\n<li>If you love dogs, then this is a great advantage of improving your security. A burglar always operates quietly to avoid getting spotted. And what&rsquo;s worse than getting barked at in the middle of the night while all the residents sleep. It&rsquo;s up to you on what kind of dog would you want to be best friends with; even a small dog can scare a burglar with high-pitched barks.</li>\r\n<li>Fool them with security decals even if you don&rsquo;t have a security system. A burglar will move on rather than risking his freedom when he knows you might have a security system. Even putting on some scary signs like having a ferocious dog will lessen the chance of a break-in.</li>\r\n<li>A very effective way of improving your security is to have the ability to see everything. At low-prices, there are security cameras widely available in the market that can even be installed by yourself.</li>\r\n<li>In case there&rsquo;s a break-in, security alarms are a great help. You can install them in the interiors of each room or on the exterior of your house. There are a lot of options and types of security alarms to choose from such as window or door activation, to infrared sensors. Once the alarm goes off, it&rsquo;s over for the bad guys.</li>\r\n</ol>\r\n<p>With all these in mind, you can rest assured that your premise will be a difficult target of burglary.</p>\r\n<p>&nbsp;</p>', 'Our home should be our haven from the cruel world outside. Its the place we should be living peacefully and protected at all time. Thats why we have to make sure that your home is well-protected and wont be an easy target for unwanted guests whether it is day or night. Read on to learn to improve', 'post', 'home security, residential locksmith, secure your property', 'Our home should be our haven from the cruel world outside. Its the place we should be living peacefully and protected at all time.', 'a:1:{i:0;s:21:"Residential Locksmith";}', 'home security, improve security of home', NULL, 'admin', 1, '2017-09-07 07:11:20', '2017-09-19 00:29:54'),
(31, 'Locksmith Mistakes That Can Be Easily Avoided', 'locksmith-mistakes-that-can-be-easily-avoided', '<p>Locksmiths are meant to help people that are having issues with their locks especially in a locked out situation. People tend to call any locksmith they could find not knowing how they can fall to a victim of scam and fraud. Don&rsquo;t be one of these people and be smart. You may know it, but some of these tips will help you avoid potential locksmith scams.</p>\r\n<p>It&rsquo;s a major mistake not to ask about their credentials. Not knowing if they are certified and you decided to hire them is a huge mistake. Being certified means a lot of training, experiences, skills, and education in the field. He may be an expert but not being certified can result to damage of your locks or keys rather than fixing them. You could even hire a person with a criminal record giving him access to your home or car.</p>\r\n<p>Choosing a locksmith company without doing any research is an amateur mistake. There are a lot of companies competing with each other, and it&rsquo;s challenging to find which is the perfect one. And choosing the wrong one can lead to devastating results. Though doing an extensive-research is not necessary, all you have to do is know about their services, reputation, their years in the industry, and experiences. Or better yet, call the company and ask them about these qualifications. Ask about their tools and equipment and if they are capable of dealing with modern lock security systems. If they can&rsquo;t answer your questions, better move on and find another. You&rsquo;ll have to follow your gut feeling before choosing one. Take your time and choose what makes you confident and comfortable.</p>\r\n<p>If you forgot to ask for a quote before the service and the service is done, you may already have fallen into a scam. A client that didn''t ask for a quote will be an advantage for them as they can charge higher at the end of the service. To avoid this, ask for several quotes over the phone. When you found the one the suits you, the quote should be written to avoid locksmiths that charge you more than the initial quote.</p>\r\n<p>&nbsp;</p>', 'People tend to call any locksmith they could find not knowing how they can fall to a victim of scam and fraud. Dont be one of these people and be smart.', 'post', 'locksmith services, call the right locksmith, locksmith tips', 'Choosing a locksmith company without doing any research is an amateur mistake. There are a lot of companies competing with each other, and its challenging to find which is the perfect one.', 'a:1:{i:0;s:13:"Uncategorized";}', 'locksmith tips', NULL, 'admin', 1, '2017-09-10 23:47:51', NULL),
(34, 'Protecting Your Home While on Vacation', 'protecting-your-home-while-on-vacation', '<p>Excited to go to the beach and take a vacation from the countless paperwork from your annoying boss? Or can&rsquo;t wait for to go on your honeymoon with your partner in a perfect destination? Wherever we are going, we all need to go on a vacation to take a break and unwind once in a while. But don&rsquo;t forget about the security of your home. If no one can watch it for you, try these tips on how to protect your home while on vacation.</p>\r\n<p>The most efficient way of keeping your home safe is asking for a trusted person to watch over your house. It could be your neighbors, family, or friends to look out for your home while you&rsquo;re gone.<br />Installing timers on your lights and devices can make your home look occupied. Setting a specific or random time will less likely get robbed especially when someone thinks there&rsquo;s an activity happening.<br />A front porch with piled up newspapers or mails is a clear sign that no one is home. The best thing you can do is to hold off deliveries by asking your delivery service. Or if you feel confident with your neighbors, you could ask them to pick your packages, mails, and newspapers for you.</p>\r\n<p>If you are going to be out for a long time, make sure to ask someone who can trim your grass and shrubs. Neglection is the perfect way to attract burglars. Well-maintained plants can give the impression that someone is home.</p>\r\n<p>Lock up everything.It&rsquo;s common sense. Even if you have the most advanced security measures, it&rsquo;s still safe to lock everything. Go to your house and lock everything from all the doors outside and inside to the windows from top to bottom. Even your garage doors should lock up.</p>\r\n<p>Even when you&rsquo;re away, you can even protect your home from your fingertips when you&rsquo;re using your mobile phone. It&rsquo;s simple but never announce your trip in social media. It&rsquo;s better just to be quiet and resist the temptation of showing off your photos. Think first before uploading because it&rsquo;s the same when telling the world that you&rsquo;re not home.</p>', 'Cant wait for to go on your honeymoon with your partner in a perfect destination? Wherever we are going, we all need to go on a vacation to take a break and unwind once in a while. But dont forget about the security of your home. ', 'post', 'home security, residential locksmith, locksmith services', 'Cant wait for to go on your honeymoon with your partner in a perfect destination? Wherever we are going, we all need to go on a vacation to take a break and unwind once in a while. But dont forget about the security of your home. ', 'a:1:{i:0;s:21:"Residential Locksmith";}', 'home locksmith,home security', NULL, 'admin', 1, '2017-09-12 02:56:20', NULL),
(35, '5 Interesting Facts About Locksmiths', '5-interesting-facts-about-locksmiths', '<p><span style="font-weight: 400;">The first thing that comes to our mind whenever we hear the word &ldquo;Locksmith&rdquo; is working with keys. They are the first person we call when we&rsquo;re having troubles with our locks most especially for lock outs. And that&rsquo;s the only thing we think of them when it&rsquo;s all about locksmiths, working with locks and keys. We have to admit that it&rsquo;s not that interesting but here are some interesting facts that might change your opinions about locksmiths.</span></p>\r\n<blockquote>\r\n<p><span style="font-weight: 400;">They are the first person we call when we&rsquo;re having troubles with our locks most especially for lock outs. And that&rsquo;s the only thing we think of them when it&rsquo;s all about locksmiths, working with locks and keys.</span></p>\r\n</blockquote>\r\n<ol>\r\n<li style="font-weight: 400;"><span style="font-weight: 400;">Harry Houdini was a locksmith. One of the most famous magicians and escape artists Harry Houdini was once a locksmith. Before he got famous for escaping out of handcuffs under water, Houdini began to work as an apprentice to a locksmith at the age of 11. Because of his talent in picking any locks, this would later become his signature stunt to become one of the world&rsquo;s greatest magician.</span></li>\r\n<li style="font-weight: 400;"><span style="font-weight: 400;">It is one of the oldest professions. It was believed that locksmiths started 4000 years ago in Egypt and Babylon. One of the earliest evidence claimed that locksmiths started around 2500 BC that used to protect the tombs of a ruler named Khafre in the pyramid of Giza. Over the years, locksmithing has evolved through thousands of years making it an ancient yet respected profession in history.</span></li>\r\n<li style="font-weight: 400;"><span style="font-weight: 400;">King Louis XVI of France was betrayed by a locksmith. Unusual for a king, Louis XVI was interested about locks. He befriended a royal locksmith Francois Gamain and had taught him to build locks from scratch. Even to the fact that the king&rsquo;s wife warned him, Gamain betrayed the king after 20 years of friendship to the revolutionaries by exposing a chest full of important documents that would help in overthrowing the king.</span></li>\r\n<li style="font-weight: 400;"><span style="font-weight: 400;">The oldest lock found was from 4000 BC. The earliest lock was found by archeologists in Khorsabad Palace in Iraq. It&rsquo;s almost the same concept of modern day locks except that it was made entirely from wood.</span></li>\r\n<li style="font-weight: 400;"><span style="font-weight: 400;">A diver and a Locksmith. Charles Courtney was a diver that opens safe deep underwater for 400 feet. Because of his talent, he had recovered over millions of dollars for salvaged companies giving him fame internationally as a Master Locksmith.</span></li>\r\n</ol>', 'The first thing that comes to our mind whenever we hear the word Locksmith is working with keys. They are the first person we call when were having troubles with our locks most especially for lock outs.', 'post', 'locksmiths, history of locksmiths', 'The first thing that comes to our mind whenever we hear the word Locksmith is working with keys. They are the first person we call when were having troubles with our locks most especially for lock outs.', 'a:3:{i:0;s:21:"Residential Locksmith";i:1;s:20:"Commercial Locksmith";i:2;s:20:"Industrial Locksmith";}', 'locksmiths,automotive locksmith,locks and keys', 'uploads/images/page/2017/banner-single-blog.jpeg', 'admin', 1, '2017-09-14 04:20:55', '2017-10-03 01:03:37'),
(36, 'Is Locksmith a Scam?', 'is-locksmith-a-scam', '<p>When you get locked out of your home or car, and you can&rsquo;t find your keys, the first thing you could do is to call a locksmith. But something made you hesitate before dialing the number of a locksmith. Then you suddenly remembered all the things you heard about their reputation of being a fraud and a scam.</p>\r\n<p>It&rsquo;s a common misconception that all locksmiths are scammers and frauds. But it&rsquo;s not always true because honest locksmiths are just difficult to find. Some locksmiths are not even professionals but charge you high with their easy service that you could even do it by yourself. It&rsquo;s the same thing from other professionals, they offer quality services, but their rates are too high.</p>\r\n<p>Anyone can lock a pick, and anyone can make a pretty convincing website. If it''s true on what they claim on their website and you&rsquo;re too naive that you chose this type of locksmith, then you just have been trapped from a spider&rsquo;s web.</p>\r\n<p>But with the correct research and a few series of questions, you can distinguish the difference between a fraud locksmith and a professional locksmith. People who say that all locksmiths are scams are not fully aware on how to choose the perfect locksmith. That&rsquo;s why they get ripped-off or scammed rather than getting the quality service they need.</p>\r\n<p>But sometimes, we feel like getting ripped-off even though we&rsquo;ve chosen the perfect locksmith. When we&rsquo;ve tried several ways in opening a locked door and can&rsquo;t be opened, we tend to get frustrated until to the point we have to call a locksmith. Then just a few minutes, your lock was opened by a locksmith with the use of a simple tool and a few fiddling. It&rsquo;s like being overcharged when our hard earned money was taken away because of a simple job.</p>\r\n<p>But it&rsquo;s not unfair. You think that the job was so simple but in reality, it was not. You have to understand that being a locksmith requires skill, experience, and practice. Many people don&rsquo;t understand these that is why they think they&rsquo;re getting ripped-off. If the job is done fast and perfectly, that means your locksmith is an expert.</p>\r\n<p>So if you think all locksmiths are scammers, then you&rsquo;re just one of those ignorant customers. Honest locksmiths have been taken for granted because not many people appreciate the things they do. When you picked the perfect locksmith, then you&rsquo;re lucky enough of not being scammed. All you have to do is appreciate their service because they&rsquo;re the one who can ensure your safety and security with your locks.</p>\r\n<p>&nbsp;</p>', 'When you get locked out of your home or car, and you cant find your keys, the first thing you could do is to call a locksmith. But something made you hesitate before dialing the number of a locksmith. Then you suddenly remembered all the things you heard about their reputation of being a fraud and ', 'post', 'locksmith scam, locksmith misconceptions', 'Its a common misconception that all locksmiths are scammers and frauds. But its not always true because honest locksmiths are just difficult to find. Read on to learn more.', 'a:1:{i:0;s:13:"Uncategorized";}', 'locksmith scam', NULL, 'admin', 1, '2017-09-19 00:39:02', NULL),
